import React from 'react';
import './servicesPage.css';

const ServicesPage = () => {
  return (
    <div className='services'>
      <div className='services-top'></div>
      <div className='services-middle'></div>
      <div className='services-bottom'></div>
    </div>
  )
}

export default ServicesPage
